import "./App.css";
import allCountryScores from "./score";

function App() {
  return (
    <div className="App">
      <h1>High Score Per Country</h1>
      <MakeList />
    </div>
  );
}

function MakeList() {
  return allCountryScores.map((country, index) => (
    <div key={index}>
      <h1>HIGH SCORES:{country.name}</h1>
      <ul>
        {country.scores.map((element) => (
          <h1>element.s</h1>
        ))}
      </ul>
    </div>
  ));
}
export default App;
